import { makeStyles } from "@material-ui/core/styles";

export default makeStyles((theme) => ({
	search: {
		paddingLeft: "20px",
		justifyContent: "center",
		height: "50px",
		width: "100%",
		border: "1px solid #E8E8E8",
		background: "#F6F6F6",
		boxSizing: "border-box",
		borderRadius: "100px",
	},
}));
